import { NavLink } from "react-router-dom";
const Login = () => {
  return (
    <>
      <h1>Login form</h1>
      <div className=" text-center">
        <NavLink className="btn btn-success ml-3" to="/hr/dashboard">
          MaxHr
        </NavLink>
        <NavLink className="btn btn-warning" to="/manager/dashboard">
          Manager
        </NavLink>
      </div>
    </>
  );
};

export default Login;
